content.css:
.privacy_prompt { 
     position: absolute; 
     width: 600px; 
     top: 100px; 
     left: 50%; 
     margin-left: -300px; 
     text-align: left; 
     border: 1px solid #CCC; 
     border-radius: 4px; 
     background-color: #FFF; 
     color: #444; 
     font-size: 14px; 
     z-index: 1000; 
     word-break: break-word; 
 } 

 .privacy_prompt a { 
     text-decoration: none; 
     color: #0077bf; 
 } 

 .privacy_prompt_content { 
     padding: 20px; 
     font-size: 0.9em; 
 } 

 .privacy_prompt h1 { 
     font-size: 1.3em; 
     color: #444; 
     font-weight: 400; 
 } 

 .privacy_prompt .option { 
     margin: 10px 0px; 
     color: #444; 
 } 

 .privacy_prompt_footer { 
     padding: 0px 20px 20px 20px; 
     overflow: auto; 
 } 

 .privacy_prompt_footer a { 
     font-size: 0.9em; 
 } 

 .privacy_prompt_footer .button { 
     font-size: 1.0em; 
     border: 1px solid #CCC; 
     padding: 4px 15px; 
     min-width: 50px; 
     text-align: center; 
     border-radius: 4px; 
     background-color: #EEE; 
     box-shadow: inset 0px 1px 4px rgba(255, 255, 255, 1); 
     text-shadow: 1px 1px 3px rgba(255, 255, 255, 1); 
     color: #000; 
     cursor: pointer; 
 } 

 .privacy_prompt .button.right { 
     float: right; 
 } 

 .privacy_prompt .button.left { 
     float: left; 
 } 

 .privacy_prompt &gt; .close_btn_thick { 
     position: absolute; 
     display: block; 
     top: 10px; 
     right: 10px; 
     text-decoration: none; 
     text-shadow: 0 1px 0 #fff; 
     color: #777; 
     font: 14px/100% arial, sans-serif; 
     cursor: pointer; 
 } 

 .privacy_prompt &gt; .close_btn_thick:after { 
     content: &quot;\2716&quot;;  
 } 

 .privacy_prompt .logo { 
     float: right; 
 } 

 .privacy_prompt table { 
     padding: 0px; 
     border-collapse: collapse; 
      margin: 0 auto; 
 } 

 .privacy_prompt table tr:first-child &gt; th { 
    width: 33%; 
 } 

 .privacy_prompt table th { 
     background-color: #FAFAFA; 
     border-bottom: 1px solid #EEE; 
     margin: 0px; 
     padding: 5px 8px; 
     font-weight: 400; 
     text-align: center; 
 } 

 .privacy_prompt table td { 
     vertical-align: top; 
     padding: 10px 8px 5px 8px; 
 } 

 .privacy_prompt table tr td:first-child { 
     min-width: 120px; 
     font-weight: 600; 
     color: #666; 
 } 

 .privacy_prompt table tr td:last-child { 
     text-align: center; 
     min-width: 100px; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle { 
     opacity: 0; 
     position: absolute; 
     left: -99999px; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label { 
     height: 24px; 
     line-height: 24px; 
     background-color: #ccc; 
     padding: 0px 16px; 
     border-radius: 16px; 
     display: inline-block; 
     position: relative; 
     cursor: pointer; 
     -moz-transition: all 0.25s ease-in; 
     -o-transition: all 0.25s ease-in; 
     -webkit-transition: all 0.25s ease-in; 
     transition: all 0.25s ease-in; 
     -moz-box-shadow: inset 0px 0px 2px rgba(0, 0, 0, 0.5); 
     -webkit-box-shadow: inset 0px 0px 2px rgba(0, 0, 0, 0.5); 
     box-shadow: inset 0px 0px 2px rgba(0, 0, 0, 0.5); 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label:before, .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label:hover:before { 
     content: &quot; &quot;; 
     position: absolute; 
     top: 2px; 
     left: 2px; 
     width: 26px; 
     height: 20px; 
     background: #fff; 
     z-index: 2; 
     -moz-transition: all 0.25s ease-in; 
     -o-transition: all 0.25s ease-in; 
     -webkit-transition: all 0.25s ease-in; 
     transition: all 0.25s ease-in; 
     -moz-border-radius: 14px; 
     -webkit-border-radius: 14px; 
     border-radius: 14px; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label .off, .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label .on { 
     color: #fff; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label .off { 
     margin-left: 20px; 
     display: inline-block; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label .on { 
     display: none; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle:checked + label .off { 
     display: none; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle:checked + label .on { 
     margin-right: 20px; 
     display: inline-block; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle:checked + label, .privacy_prompt input[type=&quot;checkbox&quot;].toggle:focus:checked + label { 
     background-color: #3278c0; 
 } 

 .privacy_prompt input[type=&quot;checkbox&quot;].toggle:checked + label:before, .privacy_prompt input[type=&quot;checkbox&quot;].toggle:checked + label:hover:before, .privacy_prompt input[type=&quot;checkbox&quot;].toggle:focus:checked + label:before, .privacy_prompt input[type=&quot;checkbox&quot;].toggle:focus:checked + label:hover:before { 
     background-position: 0 0; 
     top: 2px; 
     left: 100%; 
     margin-left: -28px; 
 } 
  .privacy_prompt input[type=&quot;checkbox&quot;].toggle + label { 
    overflow: hidden;
     text-overflow: ellipsis;
     max-height: 24px;
     height: 24px;
     }
 @media (max-width: 780px) {
    #__tealiumGDPRcpPrefs .privacy_prompt {
        width: 90%;
     margin: 0 auto;
     left: 5%;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content .prefmessage {
        float: none;
        width: 100%;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content h1 {
        text-align: center;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content img {
        float: none;
        margin: 0 auto 10px auto;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content table,
    #__tealiumGDPRcpPrefs .privacy_prompt_content thead,
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody,
    #__tealiumGDPRcpPrefs .privacy_prompt_content th,
    #__tealiumGDPRcpPrefs .privacy_prompt_content td,
    #__tealiumGDPRcpPrefs .privacy_prompt_content tr {
        position: relative;
        height: 100%;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content table tbody tr {
        display: block;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody tr {
        margin: 0 0 1rem 0;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody tr td:first-child {
        display: inline-block;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody tr td:nth-child(2) {
        width: 100%;
        display: block;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody tr td:nth-child(3) {
        min-width: 0 !important;
        position: absolute;
        right: 0;
        top: -2%;
        padding-right: 0px;
    }
    #__tealiumGDPRcpPrefs .privacy_prompt_content tbody tr:first-child {
        position: absolute;
        top: -9999px;
        left: -9999px;
    }
}

content.html:
&lt;div class=&quot;privacy_prompt consent_preferences&quot;&gt;
  &lt;div class=&quot;privacy_prompt_content&quot;&gt;
    &lt;h1&gt;{{title}}&lt;/h1&gt;
    &lt;img src=&quot;{{company_logo_url}}&quot; class=&quot;logo&quot;&gt;
    &lt;p&gt;{{message}}&lt;/p&gt;
    &lt;table&gt;
      &lt;tr&gt;
        &lt;th&gt;{{category}}&lt;/th&gt;
        &lt;th&gt;{{description}}&lt;/th&gt;
        &lt;th&gt;{{status}}&lt;/th&gt;
      &lt;/tr&gt;
&lt;!--CATEGORIES--&gt;    &lt;/table&gt;
  &lt;/div&gt;
  &lt;div class=&quot;privacy_prompt_footer&quot;&gt;
    &lt;div id=&quot;preferences_prompt_submit&quot; class=&quot;button right&quot;&gt; {{confirmation_button}}&lt;/div&gt;
  &lt;/div&gt;
  &lt;div class=&quot;close_btn_thick&quot;&gt;&lt;/div&gt;
&lt;/div&gt;

content.javascript:
/***************************************************************************
	MODIFYING THE CODE BELOW THIS WILL AFFECT THE CONSENT MANAGEMENT.
	  PLEASE CONTACT SUPPORT FOR ASSISTANCE IF YOU NEED TO MODIFY.
***************************************************************************/
(function preferences_prompt() {
  var $el = document.getElementById(&quot;preferences_prompt_submit&quot;),
      $modal = document.getElementById(&quot;__tealiumGDPRcpPrefs&quot;),
      $closeBtn = $modal.getElementsByClassName(&quot;close_btn_thick&quot;)[0],
      $body = $modal.getElementsByClassName(&quot;consent_preferences&quot;)[0],
      reg_match = /\d+$/,
      i;

  var callBack = function () {

    var inputs = $body.getElementsByClassName(&quot;toggle&quot;),
        cats = {};

    for (var i = 0; i &lt; inputs.length; i++) {
      var obj = inputs[i];
      cats[obj.id.match(reg_match)[0]] = obj.checked ? 1 : 0;
    }
    closePrompt();

    utag.gdpr.setPreferencesValues(cats);
    /**** Uncomment to allow a view event to take place after preferences have been set
     setTimeout(function (){if (window.utag &amp;&amp; window.utag.udoname || window.utag_data) {utag.view(window[window.utag &amp;&amp; window.utag.udoname || &quot;utag_data&quot;]);}},0);
     ****/
  };
  var closePrompt = function () {
    $modal.style.display = &quot;none&quot;;
  };


  var consentState = utag.gdpr.getConsentState();
  if (typeof consentState === &quot;number&quot;) {
    var _state = false;
    if (consentState === 1 || consentState === -1){
      _state = consentState === 1;
    } else {
      _state = !!utag.gdpr.preferences_prompt.defaultState;
  }
  var activeCats = utag.gdpr.getCategories(true);
  for (var i = 0; i &lt; activeCats.length; i++) {
    var id = utag.gdpr.preferences_prompt.categories[activeCats[i]].id;
    document.getElementById(&quot;toggle_cat&quot; + id).checked = _state;
  }
  } else {
    for (i = 0; i &lt; consentState.length; i++) {
      if (consentState[i].ct !== &quot;1&quot;) {
        continue;
      }
      var el = document.getElementById(&quot;toggle_cat&quot; + (i + 1));
      if(el){ el.checked = true;}
    }
  }


  if (document.addEventListener) {
    $el.addEventListener(&quot;click&quot;, callBack, false);
    $closeBtn.addEventListener(&quot;click&quot;, closePrompt, false);
  } else if (document.attachEvent) {
    $el.attachEvent(&quot;click&quot;, callBack);
    $closeBtn.attachEvent(&quot;click&quot;, closePrompt);
  } else {
    $el.onclick = callBack;
    $closeBtn.onclick = closePrompt;
  }
}());

